import React from 'react';
import { Router, Route, Switch } from "react-router";

export default function Header(){
    return(
        <header>
            <div className="header_container">
                <ul>
                    <li className="logo">Logo</li>
                    <li>Play</li>
                    <li>About</li>
                    <li>Contact</li>
                </ul>
            </div>
        </header>
    );
}
